import Profile from './profile/Profile.js';


function App() {
    return (
        <div className="App">
            <Profile 
            fullName="Amine Merzougui"
            profession="Web Developer"
            bio="I Design and Code, also I love cats"
            ></Profile>
            <h2>{this.props.FullName}</h2>
            <h2>{this.props.profession}</h2>
            <h2>{this.props.bio}</h2>
        </div>
    );
}





export default App;
